import './App.css';
import { useNavigate, useLocation } from 'react-router-dom';
import {HomePage, FindaGame } from '.pages'

function App() {
  const navigate = useNavigate();
  const location = useLocation();

  return (
    <div>
      <HomePage location={location} />
      <FindaGame location={location} />
    </div>
  );
}

export default App;
